    "headlineNews": "Patrick Mahomes completed 27-of-36 passes for 337 yards and three touchdowns in Kansas City's 33-29 Week 1 comeback over the Browns.\n",
    "report": "",
    "analysis": "He also scrambled\u00a0five times for 18 yards and one score. Kansas City was out-gained 318 yards to 183 in the first half, facing a 22-10 deficit out of the intermission, but responded with an 11-yard strike to Travis Kelce (6/76/2) in the third quarter and eventually, a 75-yard bomb to Tyreek Hill (11/197/1) to come within two points. Kelce's second touchdown on the afternoon, an eight-yard catch underneath with 1:32 left to play, ultimately sealed the deal for Kansas City before CB Mike Hughes picked off Baker Mayfield on the final drive. Even at their best, Cleveland's defense wasn't enough to stop Mahomes from compiling QB1 numbers \u2014 a trend that should continue into Week 2 against Baltimore's defensive unit. He'll again be ranked as a top-two option in that matchup.\n",
