    "headlineNews": "Derek Carr completed 34-of-56 passes for 435 yards, two touchdowns, and one interception in the Raiders' 33-27, Week 1 win over the Ravens.\n",
    "report": "",
    "analysis": "Carr did virtually all of his damage in the second half with the Raiders hanging 23 points on the Ravens across the fourth quarter and overtime after initially falling in a 14-0 hole in the first half. Carr's 56 attempts were the third-most of his career, and his 435 yards were the fourth-most. Carr's\u00a0first touchdown was a 10-yard hookup with Darren Waller in the fourth quarter, and the second was the game-winning 31-yarder to Zay Jones in overtime with Carr fading away and Jones running free behind the defense. His interception was nearly a back-breaker at the goal line in overtime when Carr's pass went through Willie Snead's hands and popped into the air for a pick in the end zone. The Raiders got it back a couple plays later on a Lamar Jackson fumble. Carr will be a back-end QB2 for Week 2 at the Steelers.\n",
