    "headlineNews": "Russell Wilson completed 18-of-23 passes for 254 yards and four touchdowns in Seattle's 28-16 Week 1 win over the Colts.\n",
    "report": "",
    "analysis": "In Shane Waldron's play-calling debut as Seattle's OC, the team came out firing with three touchdowns on four first-half possessions, two being 23- and (nice) 69-yard scores over the top to Tyler Lockett (4/100/2). Its\u00a0offense emphasized rhythm more so than outright pass/run splits, leading to a median 54.7% pass play rate but, overall, 7.8 yards per play and 11 yards per attempt through the air; being across from Indianapolis' defense short Xavier Rhodes also helped. Fantasy managers who took a chance on Wilson after the top-five options in drafts should continue reaping the rewards of the team's new-look O\u00a0against the Titans in Week 2.\n",
