    "headlineNews": "Kyler Murray completed 21-of-32 passes for 289 yards, four touchdowns and an interception in the Cardinals' 38-13, Week 1 win over the Titans, adding five rushes for 20 additional yards and a touchdown.\u00a0\n",
    "report": "",
    "analysis": "As Ryan Tannehill took sacks and turned the ball over, Murray put it in the end zone one time after another, becoming just the sixth player in NFL history to notch at least four passing touchdowns and a ground score in Week 1. Like Tannehill, Murray's protection was far from spotless, but unlike Tannehill, Murray kept Houdini-ing out of trouble for big plays with his legs and bigger throws. His passing scores went for five, 17, 26 and 11 yards, with the first two finding DeAndre Hopkins and the second two ending up in the hands of forgotten fourth-year pro Christian Kirk. Murray's INT was one of his only poor decisions. Murray had plenty of time in the pocket before simply forcing a ball to\u00a0Demetrius Harris. Murray now heads home for his Week 2 home debut against the Vikings.\u00a0\n",
