    "headlineNews": "Dak\u00a0Prescott completed 42-of-58 passes for 403 yards, three touchdowns and an interception in the Cowboys' 31-29, Week 1 loss to the Bucs.\u00a0\n",
    "report": "",
    "analysis": "Making his first start following last year's catastrophic leg break and this summer's shoulder woes, Prescott tied his career high for attempts in a seesaw affair where the Cowboys never attempted to establish the run vs. the Bucs' dominant front. Prescott's arm strength was noticeably limited compared to his career norm, but it didn't matter as he displayed elite ball placement and near perfect accuracy as he found Amari Cooper for 13 receptions and CeeDee Lamb for seven. He looked like Peyton Manning in his post-arm strength prime, simply putting the ball wherever he wanted against an elite defense, albeit one that lost its slot corner early in the game. Presumably, Prescott's arm will also get stronger as the year wears on. 10 days rest ahead of Week 2 could not be better timed as Prescott prepares to face the Chargers. With the Cowboys' defense looking almost as bad as last year's version this evening, the attempts will continue to roll right in for Prescott.\u00a0\n",
