    "headlineNews": "Joe Burrow completed 20-of-27 passes for 261 yards and two touchdowns in the Bengals' 27-24, Week 1 win over the Vikings.\n",
    "report": "",
    "analysis": "The Bengals reportedly had a rough training camp and Burrow saw a single three-and-out during the preseason. With plenty of doubt surrounding his return from a torn ACL and MCL, Burrow looked as good as he did last year versus the Vikings. Like last year, Cincinnati's horrid offensive line betrayed Burrow at times, resulting in him taking five sacks. Alongside the sacks came Burrow's willingness to hang in the pocket and take shots.\u00a0His highlight of the day came on a 50-yard dime to Ja'Marr Chase that resulted in a walk-in touchdown. After taking a hit in the fourth quarter, Burrow got up gingerly and spent a few minutes on a bike between drives. He didn't miss any time but his mobility will be something to monitor in the Bengals' Week 2 matchup with the Bears.\u00a0\n",
