    "headlineNews": "Sam Darnold completed\u00a024-of-35 passes for\u00a0279 yards, one passing touchdown and one rushing touchdown in the Panthers' 19-14, win over the Jets.\n",
    "report": "",
    "analysis": "Darnold looked fairly Darnold-y overall. The quarterback\u00a0wasn't completely in\u00a0sync with his receivers and missed\u00a0high on a would-be touchdown to Ian Thomas early in the game. He did connect with Robby Anderson on a deep touchdown later on, and showed some nice chemistry with D.J. Moore as the game went on. Christian McCaffrey was Darnold's\u00a0favorite target, as\u00a0the running back did his best slot receiver impression in addition to carrying the load as a rusher. Darnold's weapons will make him a\u00a0QB2 in when the Panthers host the Saints in Week 2.\n",
