    "headlineNews": "Jimmy Garoppolo completed 17-of-25 passes for 314 yards and one touchdown in the 49ers' 41-33, Week 1 win over the Lions.\n",
    "report": "",
    "analysis": "Trey Lance came on to vulture a five-yard touchdown from Garoppolo in the first quarter, but it was the only pass the rookie would throw all day. Garoppolo's day started as bad as it could with a lost fumble on a bad exchange on the opening play of the game, but it was all good from there. His touchdown was a nicely-thrown ball to Deebo Samuel down the right side that Samuel took 79 yards to the house. Averaging a monstrous 12.6 yards per attempt should quiet the Lance crowd for at least a week ahead of a Week 2 date with the Eagles. Garoppolo is not a fantasy recommendation on such low pass volume.\n",
