    "headlineNews": "Aaron Rodgers completed 15-of-28 pass attempts for 133 yards and two interceptions in the Packers' Week 1 loss to the Saints.\u00a0\n",
    "report": "",
    "analysis": "Jordan Love replaced Rodgers with Green Bay down 38-3 in the fourth quarter. Rodgers was under pressure for much of the game and indecisive when he had time to operate in the pocket. He targeted Davante Adams and Marquez Valdes-Scantling seven times each in pass-heavy negative game script. The swarming Saints defense made life miserable for Rodgers and the Packers offense, which didn't convert a single third down in the game's first three quarters. Regression looked ugly for the Packers in Week 1. It might look less ugly next week against a Detroit defense that was ripped by the 49ers on Sunday.\u00a0\n",
