    "headlineNews": "Tua Tagovailoa completed 16-of-27 passes for 202 yards, one touchdown and an interception in the Dolphins' 17-16, Week 1 win over the Patriots.\u00a0\n",
    "report": "",
    "analysis": "It was not an overly impressive day from the hyped second-year starter, but that was the expectation going in against an elite defense without Will Fuller. Tagovailoa's interception was the kind of decision he simply can't be making as a sophomore, however, as he was getting pounded for a sack and blindly heaved the ball near the sideline. It resulted in a critical fourth quarter turnover. Thankfully for Tagovailoa, the Patriots responded with an even-costlier giveaway. Tagovailoa took only two sacks, but he was running for his life behind the Dolphins' makeshift offensive line. That is certainly going to remain a concern going forward. With Fuller returning, Tagovailoa has another tough Week 2 test in the Bills before things soften up with the Raiders.\u00a0\n",
