    "headlineNews": "The Titans used play action on 11.6 percent of their Week 1 offensive plays, down from 36.4 percent in 2020.\u00a0\n",
    "report": "",
    "analysis": "Former Titans offensive coordinator Arthur Smith utilized play action to perfection in 2019 and 2020, keeping opposing defenses off balance. Ryan Tannehill's career resurgence could be credited largely to the team's league-high play action usage. Tannehill's yards per attempt jumped by 2.8 when using play action last season, and he was Pro Football Focus' sixth best QB when using play action. Tannehill and the Tennessee offense were disastrous in Week 1 against a poor Arizona secondary, as Tannehill completed 21 of 35 attempts for 212 yards and a touchdown. He was sacked six times. Offensive coordinator Todd Downing might consider more play action calls this week against the Seahawks.\u00a0\n",
