    "headlineNews": "Christian McCaffrey rushed 21 times for 98 yards in the Panthers' Week 1 win over the Jets, adding nine receptions for 89 additional yards.\n",
    "report": "",
    "analysis": "McCaffrey has the first four touches for the Panthers, which included a\u00a017 yard screen pass that was wiped out by penalty. Sam Darnold was\u00a0at times locked onto McCaffrey, as if he was the Panthers'\u00a0No. 1 receiver. In terms of targets, he was.\u00a0McCaffrey led the team with nine targets and\u00a0was used repeatedly on crossing routes over the middle, which he was excellent on. He also iced the game on the Panthers' final drive when he bounced a run outside and, picked up the clinching first down and smartly slid in bounds to keep the clock running. McCaffrey will continue breaking fantasy football when he\u00a0faces the Saints in Week 2.\n",
