    "headlineNews": "Ravens OC Greg Roman said Baltimore's backfield will continue to \"rotate guys in and out.\"\n",
    "report": "",
    "analysis": "\"We really just kind of rotated guys,\" Roman continued. \"The game played out the way it did. We're not going to put in one back and have him play the whole game. Those days are over. We're going to rotate guys in and out.\"\u00a0Ty'Son Williams played 24 snaps during Baltimore's first six drives on Monday, for example, but was only in on 11 for the team's final seven possessions despite out-performing Latavius Murray and Trenton Cannon (since cut) both on the field and in the box score. With Devonta Freeman promoted to the active roster, Baltimore will apparently rotate Murray, Freeman, and Williams for the foreseeable future. Le'Veon Bell also remains buried on the team's practice squad.\n",
