    "headlineNews": "Miles Sanders rushed 15 times for 74 yards in the Eagles' Week 1 win over Atlanta, adding four receptions for 39 yards.\u00a0\n",
    "report": "",
    "analysis": "Sanders out-snapped main backfield mate Kenneth Gainwell nearly 2-to-1, and tacked on a two-point conversion to make up a bit for the touchdown you'd hoped to see. He added a couple of nice pass protection pickups. Perhaps of more worry is that Sanders didn't have a single red zone target or rush attempt -- though he did have plenty of carries in Atlanta territory. The workload concerns should leave him as a mid-range RB2 for next Sunday's tilt against the 49ers, but Sanders' speed and tackle-breaking ability came through in his performance today.\u00a0\n",
