    "report": "",
    "analysis": "Gaskin was the Dolphins' clear No. 1 back, leading in touches and playing more than 50 percent of the snaps, but he handled just 9-of-23 carries with Malcolm Brown and Salvon Ahmed both tallying five. Pro Football Focus charted him as being on the field for 29-of-54 plays. Not ruinous, but that also would not be enough for consistent RB2 value. We are at least starting out with a committee, but neither Brown nor Ahmed did anything to make a push for the top spot. Gaskin will be a high-floor FLEX option for Week 2 against the Bills.\u00a0\n",
