    "headlineNews": "Ezekiel Elliott rushed 11 times for 33 yards in the Cowboys' Week 1 loss to the Bucs, adding two receptions for six additional yards.\u00a0\n",
    "report": "",
    "analysis": "The Cowboys made zero attempt to #EstablishIt this evening, with Zeke entering halftime with all of four carries. There was simply no point against the Bucs' dominant front in a game that took on the air of a shootout from the opening whistle. When he did get the rock, Zeke didn't look particularly quick to the edge, getting caught on a pair of goal-line looks, one a run and the other a reception. There is still no reason to overreact to a poor performance against maybe the toughest run defense Elliott will see all season. He will find himself back in the top eight for Week 2 against the Chargers.\u00a0\n",
