    "headlineNews": "Amari Cooper caught 13-of-16 targets for 139 yards and a pair of touchdowns in the Cowboys' Week 1 loss to the Bucs.\u00a0\n",
    "report": "",
    "analysis": "The 13 receptions were a new career high for Cooper as he picked up where last year's pre-injury mindmeld with Dak Prescott left off. Cooper's 13-of-16 target conversion was compared to 7-of-15 for CeeDee Lamb, though the prodigiously-talented sophomore also stacked up 7/104/1. Cooper's first score was a five-yarder where Prescott found him with some cushion at the front end of the end zone. The second was a 21-yarder in the third quarter where Coop took Ross Cockrell to school, humiliating him near the goal line. Tonight was essentially a shot-for-shot remake of the Cowboys' 2020, with the defense failing to enter the same area code as Tom Brady and Prescott needing to pile up attempts on offense. We would have to imagine things unfold much the same way in Week 2 against the Chargers, putting Cooper firmly in the WR1 mix.\u00a0\u00a0\n",
