    "headlineNews": "Christian Kirk caught 5-of-5 targets for 70 yards and two touchdowns in the Cardinals' Week 1 win over the Titans.\u00a0\n",
    "report": "",
    "analysis": "Kirk is now 33 percent of the way to his 2020 touchdown total after notching 26- and 11-yard scores, both coming in the second half as the Cardinals put the finishing touches on a road beatdown. The 26-yarder was a thing of beauty, as a pressured Kyler Murray simply lofted the ball off his back foot and Kirk managed to track it over his shoulder. For the 11-yard strike, Kirk beat S Kevin Byard 1-on-1 in the end zone. Free agent addition A.J. Green looked no less finished this afternoon than he did for the Bengals last season, so there could still be targets for Kirk's taking even if rookie Rondale Moore impresses, which he did on Sunday. Kirk will be in the WR48-55 range for Week 2 against the Vikings.\u00a0\n",
