    "headlineNews": "Chris Godwin caught 9-of-14 targets for 105 yards and a touchdown in the Bucs' Week 1 win over the Cowboys, also losing a fumble.\u00a0\n",
    "report": "",
    "analysis": "Godwin's goal-line cough up was nearly a game coster in the fourth quarter, while he has also failed to haul in a fourth quarter bomb that would have gone in the books as a 46-yard touchdown. It was not an easy ball to track, but it was the sort of reception he usually makes. Nevertheless, both Godwin's grabs and targets led the team, though Antonio Brown took the yardage crown with 121, while Rob Gronkowski found the end zone twice. For Godwin's five-yard score in the first quarter, he went in motion before the snap and easily freed himself over the middle of the field.\u00a0AB and Mike Evans' presence will make for some inconsistency, but Godwin is simply too good of a fit with Tom Brady's skill-set to fall out of the top 18 in fantasy. The Falcons' pathetic defense is on deck for Week 2.\u00a0\n",
