    "analysis": "The five targets were a distant third on the team behind Diontae Johnson (10) and JuJu Smith-Schuster (8) on a day Big Ben attempted just 32 passes. Claypool still did damage with his minimal looks, skying over elite cover CB Tre'Davious White for a 22-yard gain and then blasting up the right side on his 25-yard reverse handoff. Still, this felt a lot like Claypool's rookie season; making big plays but seeing questionable volume. Claypool will be a risk-reward WR3 in a plus matchup with the Raiders in Week 2.\n",
