    "headlineNews": "Tyler Boyd caught 3-of-4 targets for 32 yards in the Bengals' Week 1 win over the Vikings.\n",
    "report": "",
    "analysis": "The Bengals took a ground-heavy approach in this game, tallying 36 runs to just 27 passes. With Tee Higgins and Ja'Marr Chase both demanding a floor of targets based on their talent alone, Boyd appeared to be the odd man out. His four targets were tied for third on the team and Higgins even missed some time while getting an IV. When the Bengals are playing from behind and forced to throw more, Boyd should have no problem racking up receptions and fantasy points. If they play half of the game with a lead like they did today, Boyd could struggle to be anything more than a deep FLEX option. His role in the Bengals Week 2 matchup with the Bears will be a good barometer for the volume he expects to see going forward.\u00a0\n",
