    "headlineNews": "Jaguars kicker Josh Lambo is competing for the team's starting job with Aldrick Rosas.\u00a0\n",
    "report": "",
    "analysis": "Jacksonville special teams coordinator Nick Sorensen confirmed the red-hot kicker competition during minicamp. Lambo's lingering hip injury limited him to four games in 2020 and left the team scrambling for viable kicker options. Jacksonville's cast of kickers hit 18 of their 25 field goal attempts (72 percent), the third lowest rate in the NFL. They were the third worst in extra point conversions too. The most accurate kicker in Jags history, Lambo will have to outplay Rosas this summer if he's to keep his gig in 2021. Rosas -- the seventh highest scoring kicker in 2018 as a member of the Giants -- made eight of 11 attempts last year for Jacksonville. Whoever wins the team's kicker job will have some streaming appeal this season.\n",
